import './App.css';
import RandomPhotos from './components/Fetch-data.js'

function App() {
  return (
    <>
    <div className="App">
      <header className="App-header">
        <h1>
          Random photo App
        </h1>    
      </header>

    <main>
     <RandomPhotos />

    </main>

    </div>
    </>
  );
}

export default App;
